import React from 'react'
import { Link, useNavigate } from 'react-router-dom';
function Header() {  
  
  const auth = localStorage.getItem('user');
  const navigate = useNavigate();

  const logout = ()=>{
    localStorage.clear();
    navigate('/signup');
  }

  return (
    <div className='header'>
        <ul className='hList'>
            <li className='menu'><Link to = '/'>Home </Link></li>
            <li className='menu'><Link to = '/add'>Add</Link></li>
            <li className='menu'><Link to = '/update'>Update</Link></li>
            <li className='menu'><Link to = '/profile'>Profile</Link></li>
            <li className='menu'>
              {
                auth ? <Link to = '/signup'  onClick={logout}>Logout</Link>
                :<>
                <Link className='menu' to='/login'>Login</Link>
                <Link className='menu' to= '/signup'>Sign UP</Link>
                </>
              }
            </li>
        </ul>
    </div>
  )
}

export default Header
